script: |
  super -f text -I q9279.spq | sort > q9279.out

inputs:
  - name: q9279.spq
    data: |
      SELECT ALL - 10 AS col2 FROM tab1 (FORMAT parquet) WHERE NOT - col0 * + - col0 BETWEEN - col1 AND - 35 + - + 93;
  - name: tab1

outputs:
  - name: q9279.out
    data: |
      -10
      -10
      -10
